Solicit info from Comicvine - &quot;Archie Marries Veronica -- &quot;Up in the Air!&quot;: Archie and Veronica are doing their best to not let the tumultuous events of their lives effect the love they have for one another. And they're doing pretty well, too, but is love enough to keep their legal battles at bay? Speaking of love and battles, Jughead and Ethel have some planning to do... but hopefully their stubbornness won't get in the way! And Kevin's trying his best to not let people's perceptions of him effect his Senate job, perhaps some encouraging words is all he needs. And Clay's back to work -- but things still seem new and strange. Could it just be his imagination?

Archie Marries Betty -- &quot;Not So Great Expectations!&quot;: Archie's finally had enough of Betty's busy schedule -- and he's not the only one! Will all of her hard work have paid off or has it only made matters worse? And who is it Archie's really mad at -- Betty for neglecting him? Or himself for being selfish and feeling guilty? Meanwhile, Kevin dives head first into the investigation on the nearby mall shooting after discovering that the tragedy hit closer to home than he ever could have imagined. And Jughead's waiting on bated breath as Midge's due date draws closer and closer. Oh baby, things are crazy in Riverdale!&quot;

